Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('12','9','宠物领养规则','1.一只宠物至多能被10人同时申请领养,根据审核标准决定谁胜出，其他人淘汰!
Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('36','4','关于首次医疗预约的公告','若您的宠物是初次到本救助中心进行治疗，我们会有工作人员在预约时间的前一天给您打电话确认宠物情况，以便医疗工作展开。请您确保手机号码正确以及当日手机通畅。',0,to_timestamp('31-8月 -23 10.06.29.755000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('37','4','领养基本条件','Copyright @同济猫盟
Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('34','3','领养注意','领养猫猫狗狗意味着一生为它们负责，不得弃养。救助站将会定期回访查看宠物的生活状况。我们希望宠物能够吃饱喝足，幸福快乐地生活',0,to_timestamp('31-8月 -23 09.52.32.290000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('47','2','领养须知II','在领养获得批准前，申请人必须出示其住址证明。在某些情况下，申请人须向本会出示有关屋苑管理公司之书面证明，以证实申请人之住所容许养有关之动物，本会亦可能会派管理员上门家访。
Insert into C##PET.BULLETIN (BULLETIN_ID,EMPLOYEE_ID,HEADING,BULLETIN_CONTENTS,READ_COUNT,PUBLISHED_TIME) values ('39','7','温馨提示','请勿将宠物遗弃在救助中心门口。如果您真心喜欢宠物，请在养育之前对自己进行理性评估。',0,to_timestamp('01-9月 -23 04.57.32.090000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
