1. 领养者必须年满18岁，无刑事犯罪记录，无虐待动物前科。
2. 领养者或与领养者同住的家庭成员有一份稳定的工作，有饲养宠物的经济条件。
3. 领养者能够坚持长期养护，愿意给生病的宠物治病。

二、优先考虑的标准
1. 首先领养申请者需要符合所有必须达到的标准。如符合，则考虑以下条件。
2. 若在发送领养申请后10天内没有其他符合标准的人领养同一只宠物，则直接通过该领养申请者的领养申请。若有，则在第一份领养该宠物申请被发送后的10天内，考虑以下条件。
3. 能够接受志愿者定期回访者优先，若多个领养申请者均接受志愿者定期回访，则考虑以下条件。
4. 养宠物经验丰富者优先，若领养申请者养宠经验相似，则考虑以下条件。
5. 每天能花更多时间照顾宠物者优先，若多个领养申请者能照顾宠物的时间相似，则考虑以下条件。
6. 领养后主要照顾猫狗的人是领养申请者本人则优先，若多个领养申请者领养猫狗后，主要照顾猫狗的人均是领养申请者或均不是，则考虑以下条件。
7. 家庭居住人口多者优先，若多个领养申请者家庭居住人口数类似，则考虑以下条件。
8. 若被领养宠物是大型犬类或性格不够温顺，攻击性较强，家庭中无0-10岁小孩者优先。
9. 若多个领养申请者在以上条件中均相似，则领养申请提交时间在前者优先。

三、审核通过后的流程
对接人联系领养人，领养人择日到宠物救助站签订一份领养协议，带走宠物。
