如果你符合以下领养条件，就可以直接添加猫咪的联系人的微信号进行交流。

我们设立了专门的领养审核流程以及对接人制度，会对每一位领养意向人进行认真的考察，并在猫咪送养后进行适时的线上回访以及提供科学养猫的耐心指导。

这一切都是为了帮助猫咪们活得健康、快乐、长寿。
1、领养人已成年，经济独立，在上海或周边城镇有固定住所。
2、全部同住人都欢迎猫咪成为家庭的一份子，没有对猫过敏等问题。
3、能提供干净、充足、安全、有营养的食物，并能保证猫咪每日有足够的水分摄入。①
4、仅在室内放养猫咪，不在户外散养。全屋封窗， 随手关门，以防意外。
5、认可健康家猫适龄绝育的理念，按时给猫咪打疫苗、做驱虫。
6、对猫咪终身负责，不以结婚生子、恋爱、搬家等原因抛弃猫咪或随意送养。如出现特殊情况，请领养人及时与对接学生联系。
7、同意当面交接猫咪、签订领养协议。
8、领养后接受线上回访，适时提供猫咪的生活照片，保持联络。',0,to_timestamp('31-8月 -23 11.27.56.453000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
申请人必须签署饲养同意书及缴交有关之领养费。
中心保留拒绝领养申请之权利，若领养条款及领养费有所更改，恕不另行通知。
领养动物必须接受强制性绝育，如申请领养者不接受此条款，本中心恕不能批准其申请。绝育但能避免动物于往后日子一些疾病，也可以避免一些动物被繁殖出来而没人愿意收养的情况。
中心尽可能在动物被领养前为其绝育，但某些情况下是因为动物年纪太大（指晚年）、年幼或残疾而不适宜做手术；故此，在领养时，必须为它预约于往后时间的绝育手术，申请人若要领养此类的动物。必须一次性付清领养费用，年幼小动物到达适年期，中心会另行通知，领养人必须在通知限期内接受手术，否则费用自动转到救助站帐上作为小动物生活经费。',0,to_timestamp('07-9月 -23 12.30.19.281000000 上午','DD-MON-RR HH.MI.SS.FF AM'));
