1. 捐款方式：我们接受银行转账和电子支付等多种捐款方式。请确保您提供的捐款信息准确无误。
2. 捐款用途：捐款将用于支持我们组织的相关项目和活动，包括但不限于宠物医疗、救助等。我们将确保捐款用途合法合规，并及时向捐款人提供相关项目进展和使用情况。
3. 捐款收据：我们将及时向捐款人提供捐款收据，以便您在需要时进行报销或税务申报。请提供准确的联系方式，以便我们与您取得联系。
4. 支出审计：我们将定期对捐款的支出进行审计，并向捐款人公开审计结果。我们将确保捐款的合理使用和最大化效益。
5. 捐款纠纷解决：如您对捐款使用或相关事宜有任何疑问或纠纷，我们将积极与您沟通并解决问题。我们将尽力保证捐款人的合法权益。',0,to_timestamp('01-9月 -23 05.09.55.098000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
同济大学宠物救助中心的财务部分主要涉及以下几个方面的收入和支出：
一、收入来源:
1.捐赠:用户通过宠物救助中心平台进行现金捐款，同时我们项目也接受社会公益组织的援助。流浪动物作为社会性问题，可与当地政府寻求深层次的合作和支持。
2.寄养费用:用户通过宠物救助中心申请寄养服务并支付一定的寄养费用。目前设置的寄养费用为:大型犬:30 元/天，中型犬: 25 元/天，小型犬: 20 元/天，猫: 20 元/天。
3.医疗费用: 用户通过平台预约医疗服务需支付一定的医疗费用，相关费用问题较为复杂,目前未设置具体医疗费用，后续根据实际情况设置。
4.领养费用:根据宠物的种类和状况，设定一定的领养费用，确保能够覆盖部分救助中心的支出，目前尚未设置，后续依据实际情况设置。
5.商务合作:与校内师生和社会各界爱心人士开展合作，合作形式包括且不限于义卖、产品推广、视频联动等(参考同济猫盟)。企业通过平台可以建立良好的社会形象，提高知名度和影响力，形成双赢局面。
二、支出项目：
1. 宠物护理：对宠物救助中心的宠物进行喂养、医疗、绝育、疫苗接种、驱虫、洗澡等需要支出一定的费用。
2. 人工费用：涉及到工作人员的工资、保险、福利以及培训等支出。
3. 日常运营：如设施和设备的运营费用、水电费、清洁费用、办公用品费用等。
4. 宣传推广费用：用于增加宠物救助中心的知名度，吸引更多的平台用户、志愿者、领养人以及捐赠者。

实现收支平衡可采取的措施：
1. 增加筹款活动：组织募捐活动、举办义卖会、接受来自社会公众和企业的捐赠，以增加收入来源。
2. 设定合理的领养费用：根据宠物的种类和状况，设定一定的领养费用，确保能够覆盖部分救助中心的支出。
3. 寻找合作伙伴：与动物医院、宠物食品商店、宠物美容店等建立合作关系，协商获得商品或服务的折扣，降低运营成本。
4. 提高运营效率：通过合理的管理，提高工作效率，降低人工成本和其他管理费用。以高校为背景，招募志愿者的难度不会太高，另外还可以考虑与学校达成合作，采用认定志愿时长等激励方式，实现双赢。如果高校设立了兽医相关专业，可以利用对患病宠物进行输液、投药、包扎打针等治疗训练，提高学生的宠物医学技能。
',0,to_timestamp('01-9月 -23 09.03.05.513000000 下午','DD-MON-RR HH.MI.SS.FF AM'));
领养费用（包含驱虫、种接种苗和绝育项目）
由于本中心没有把动物本身价值及其饲养费列入救助费用，同时本中心不接收捐款，因此我们恳请领养人在缴付领养费之余，能购买动物日常用品作为减轻本中心救助压力的途径，等同于给予了中心其他动物的帮助,启善感谢您的支持！

申请成为领养人必须年满21岁，如未满21岁者，可由年满21岁而同住的家人或监护人到本中心代为申请。（为了确保未满21岁的人仕，因为冲动而领养，未能尽责，让小动物再次被遗弃。领养人必须在月内实行中心50小时服务令方能领养）

领养人必须向中心承诺为动物提供一个合适的居所及 尽其所能给予动物最好的照顾。

领养人必须遵守文明的喂养方法：
1. 不喂带油、咸味食物。
2. 不能喂隔晚的剩饭菜。
3. 每年体内驱虫2次。
4. 每年春、秋两季必须每隔15天体外驱虫。
5. 每年须注射“狂犬疫苗”及“犬苗或猫苗”。

领养人首先要向家人征求允许后，为家庭中即将来临的新宠物做好了一切准备，你可以在同济大学宠物救助中心购买您所需的一切用品：
狗包括：优质狗粮、狗碗、饮水器、狗笼、牵引绳、床垫、玩具、眼药水、滴耳液、滴蚤水、指甲刀、沐浴液等···
猫包括：优质猫粮、猫笼、猫抓板、化毛膏、滴耳液、猫沙盘、猫沙、指甲刀、猫碗、饮水器、滴蚤水等···',0,to_timestamp('07-9月 -23 12.34.12.280000000 上午','DD-MON-RR HH.MI.SS.FF AM'));
